import React, { useState } from "react";
import InputField from '../components/InputField';
import ToggleButton from "../components/ToggleButton";

export default function IndexPage() {
  return (
    <div className="h-screen w-screen bg-white flex items-center justify-center">
      <div className="space-y-5">
        <label className="items-center text-lg font-semibold">
          Sign Up
        </label>
        <InputField type="text" required={true} label="Email" error="This email is invalid."/>
        <InputField type="text" required={true} label="Username" error="This username is already taken."/>
        <InputField type="password" required={true} label="Password" error="Your password must be more than 5 characters."/>
      </div>
    </div>
  );
}
